import Header from "./components/Header";
import Footer from "./components/Footer";
import Posts from "./components/Posts"
import Form from "./components/Form"


import { useState } from 'react';
import uuid from 'react-uuid';


function App() {
  const initialPosts = [
    {
      id: uuid(),
      title: 'The White Mountain',
      description: 'Lorem Ipsum is simply dummy text of the printing and    typesetting industry. Lorem Ipsum has been the industrys standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries',
      category: 'ent',
      promote: true,
      status: 'p',
      picture: "data:image/jpeg;base64,",
      likes: 0,
      dislikes: 0
    },
    {
      id: uuid(),
      title: 'The Road to somewhere',
      description: 'Lorem Ipsum is simply dummy text of the printing and    typesetting industry. Lorem Ipsum has been the industrys standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries',
      category: 'edu',
      promote: false,
      status: 'p',
      picture: "data:image/jpeg;base64,",
      likes: 15,
      dislikes: 2
    },
    {
      id: uuid(),
      title: 'Follow the flow',
      description: 'Lorem Ipsum is simply dummy text of the printing and    typesetting industry. Lorem Ipsum has been the industrys standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries',
      category: 'ent',
      promote: false,
      status: 'a',
      picture: "data:image/jpeg;base64,",
      likes: 1,
      dislikes: 37
    }
  ]
  const [post, setPost] = useState(initialPosts);

  const handleAddPost = (title, description, category, promote, status, picture) => {
    // Wrong Way!!!!!
    // const newPost = setPost('created new post!');
    // post.push(newPost)
    const updatedPosts = [...post,
    {
      id: uuid(),
      title,
      description,
      category,
      promote,
      status,
      picture,
      likes: 0,
      dislikes: 0
    }]

    setPost(updatedPosts)
  }

  //update number of likes
  const handlePostLike = (id) => {
    const updatedPost = [...post];
    updatedPost.forEach((post) => {
      if (post.id === id) {
        post.likes++
      }
    });
    setPost(updatedPost)
  }

  //update number of dislikes
  const handlePostDislike = (id => {
    const updatedPost = [...post];
    updatedPost.forEach((post) => {
      if (post.id === id) {
        post.dislikes++
      }
    })
    setPost(updatedPost)
  })

  return (

    <>
      <Header />
      <Posts
        post={post}
        onPostLike={handlePostLike}
        onPostDislike={handlePostDislike}
      />
      <Form
        onAddPost={handleAddPost}
      />
      <Footer />
    </>
  );
}

export default App;
